// import { Fragment } from 'react';
// import styled,{css} from "styled-components";
// import './App.css';

const bucketItems = [
  { id: 0, text: "세계 일주 여행" },
  { id: 1, text: "스카이 다이빙" },
  { id: 2, text: "오로라 구경하기" },
  { id: 3, text: "마라톤 완주" }
];


const App = () => {
  const buketList = bucketItems.map((bucketItem,index) => <li key={index}>{bucketItem}</li>);
  return(
    <>
    <h1>버킷리스트</h1>
    <ul>{buketList}</ul>
    </>
  )
};

export default App;
